import React, { useEffect, useRef, useState } from 'react';
import styled from 'styled-components';

const BackgroundContainer = styled.div`
  position: fixed;
  top: 0;
  left: 0;
  width: 100vw;
  height: 100vh;
  z-index: -1;
  pointer-events: auto;
  overflow: hidden;
  background: linear-gradient(135deg, #0a0a0a 0%, #1a1a1a 50%, #2d2d2d 100%);
  cursor: none;

  &:hover {
    .floating-element {
      transition: all 0.3s ease;
    }
  }
`;

const Canvas = styled.canvas`
  position: absolute;
  top: 0;
  left: 0;
  width: 100%;
  height: 100%;
  z-index: 0;
`;

const MouseTrail = styled.div`
  position: fixed;
  width: 30px;
  height: 30px;
  background: radial-gradient(circle, rgba(0, 212, 255, 1) 0%, rgba(0, 212, 255, 0.5) 70%, transparent 100%);
  border-radius: 50%;
  pointer-events: none;
  z-index: 1000;
  transition: all 0.1s ease;
  mix-blend-mode: screen;
`;

const FloatingElement = styled.div`
  position: absolute;
  color: ${props => props.color || '#00d4ff'};
  font-size: ${props => props.size || '36px'};
  opacity: 0.6;
  animation: float 6s ease-in-out infinite;
  animation-delay: ${props => props.delay || '0s'};
  transition: all 0.3s ease;
  mix-blend-mode: screen;
  z-index: 1;
  text-shadow: 0 0 10px ${props => props.color || '#00d4ff'};

  &:hover {
    opacity: 1;
    transform: scale(1.5);
    color: ${props => props.hoverColor || '#00ffff'};
    text-shadow: 0 0 30px ${props => props.hoverColor || '#00ffff'};
  }

  @keyframes float {
    0%, 100% { transform: translateY(0px) rotate(0deg); }
    50% { transform: translateY(-20px) rotate(180deg); }
  }
`;

const ChartLine = styled.div`
  position: absolute;
  height: 4px;
  background: linear-gradient(90deg, transparent, ${props => props.color || '#00d4ff'}, transparent);
  opacity: 0.5;
  animation: chartMove 8s linear infinite;
  animation-delay: ${props => props.delay || '0s'};
  z-index: 1;
  box-shadow: 0 0 10px ${props => props.color || '#00d4ff'};

  &:hover {
    opacity: 0.8;
    height: 6px;
    box-shadow: 0 0 20px ${props => props.color || '#00d4ff'};
  }

  @keyframes chartMove {
    0% { transform: translateX(-100%); }
    100% { transform: translateX(100vw); }
  }
`;

const DataPoint = styled.div`
  position: absolute;
  width: 8px;
  height: 8px;
  background: ${props => props.color || '#00d4ff'};
  border-radius: 50%;
  opacity: 0.7;
  animation: pulse 4s ease-in-out infinite;
  animation-delay: ${props => props.delay || '0s'};
  z-index: 1;
  box-shadow: 0 0 15px ${props => props.color || '#00d4ff'};

  &:hover {
    opacity: 1;
    transform: scale(2);
    box-shadow: 0 0 25px ${props => props.color || '#00d4ff'};
  }

  @keyframes pulse {
    0%, 100% { transform: scale(1); opacity: 0.7; }
    50% { transform: scale(1.5); opacity: 0.9; }
  }
`;

const GridLine = styled.div`
  position: absolute;
  background: linear-gradient(90deg, transparent, ${props => props.color || '#00d4ff'}, transparent);
  opacity: 0.2;
  animation: gridPulse 10s ease-in-out infinite;
  animation-delay: ${props => props.delay || '0s'};
  z-index: 0;

  &:hover {
    opacity: 0.4;
    box-shadow: 0 0 10px ${props => props.color || '#00d4ff'};
  }

  @keyframes gridPulse {
    0%, 100% { opacity: 0.2; }
    50% { opacity: 0.3; }
  }
`;

const AnimatedBackground = () => {
  const canvasRef = useRef(null);
  const [mousePosition, setMousePosition] = useState({ x: 0, y: 0 });
  const [isHovering, setIsHovering] = useState(false);

  // Tech & Finance Icons
  const techIcons = [
    { icon: 'ðŸ“Š', name: 'chart', color: '#00d4ff', hoverColor: '#00ffff' },
    { icon: 'ðŸ“ˆ', name: 'trending', color: '#00ff88', hoverColor: '#00ffaa' },
    { icon: 'ðŸ’°', name: 'money', color: '#ffd700', hoverColor: '#ffff00' },
    { icon: 'ðŸ’³', name: 'card', color: '#ff6b6b', hoverColor: '#ff8e8e' },
    { icon: 'ðŸ¦', name: 'bank', color: '#4ecdc4', hoverColor: '#6ee7df' },
    { icon: 'ðŸ“±', name: 'mobile', color: '#45b7d1', hoverColor: '#67c9e1' },
    { icon: 'ðŸ’»', name: 'laptop', color: '#96ceb4', hoverColor: '#b8e0c6' },
    { icon: 'ðŸ”—', name: 'blockchain', color: '#feca57', hoverColor: '#ffd78a' },
    { icon: 'âš¡', name: 'lightning', color: '#ff9ff3', hoverColor: '#ffb3f7' },
    { icon: 'ðŸŽ¯', name: 'target', color: '#54a0ff', hoverColor: '#76b2ff' },
    { icon: 'ðŸ“Š', name: 'analytics', color: '#5f27cd', hoverColor: '#7f47ed' },
    { icon: 'ðŸ”¢', name: 'numbers', color: '#00d2d3', hoverColor: '#22f2f3' },
    { icon: 'ðŸ“‰', name: 'decline', color: '#ff6348', hoverColor: '#ff8568' },
    { icon: 'ðŸ“Š', name: 'bar-chart', color: '#2ed573', hoverColor: '#4ef593' },
    { icon: 'ðŸ’¹', name: 'growth', color: '#1e90ff', hoverColor: '#40b0ff' }
  ];

  // Chart data points for line graphs
  const chartData = [
    { x: 10, y: 20, color: '#00d4ff' },
    { x: 25, y: 60, color: '#00ff88' },
    { x: 40, y: 40, color: '#ffd700' },
    { x: 55, y: 80, color: '#ff6b6b' },
    { x: 70, y: 30, color: '#4ecdc4' },
    { x: 85, y: 70, color: '#45b7d1' }
  ];

  useEffect(() => {
    const canvas = canvasRef.current;
    const ctx = canvas.getContext('2d');

    const resizeCanvas = () => {
      canvas.width = window.innerWidth;
      canvas.height = window.innerHeight;
    };

    resizeCanvas();
    window.addEventListener('resize', resizeCanvas);

    // Mouse tracking
    const handleMouseMove = (e) => {
      setMousePosition({ x: e.clientX, y: e.clientY });
    };

    const handleMouseEnter = () => setIsHovering(true);
    const handleMouseLeave = () => setIsHovering(false);

    window.addEventListener('mousemove', handleMouseMove);
    window.addEventListener('mouseenter', handleMouseEnter);
    window.addEventListener('mouseleave', handleMouseLeave);

    // Canvas animation
    let animationId;
    const animate = () => {
      ctx.clearRect(0, 0, canvas.width, canvas.height);

      // Draw grid pattern
      ctx.strokeStyle = 'rgba(0, 212, 255, 0.15)';
      ctx.lineWidth = 1;

      for (let i = 0; i < canvas.width; i += 50) {
        ctx.beginPath();
        ctx.moveTo(i, 0);
        ctx.lineTo(i, canvas.height);
        ctx.stroke();
      }

      for (let i = 0; i < canvas.height; i += 50) {
        ctx.beginPath();
        ctx.moveTo(0, i);
        ctx.lineTo(canvas.width, i);
        ctx.stroke();
      }

      // Draw moving data streams
      const time = Date.now() * 0.001;
      for (let i = 0; i < 5; i++) {
        ctx.strokeStyle = `rgba(0, 212, 255, ${0.25 + Math.sin(time + i) * 0.1})`;
        ctx.lineWidth = 3;
        ctx.beginPath();

        for (let x = 0; x < canvas.width; x += 10) {
          const y = canvas.height / 2 + 
                   Math.sin(x * 0.01 + time + i) * 50 + 
                   Math.sin(x * 0.005 + time * 2 + i) * 30;

          if (x === 0) {
            ctx.moveTo(x, y);
          } else {
            ctx.lineTo(x, y);
          }
        }
        ctx.stroke();
      }

      animationId = requestAnimationFrame(animate);
    };

    animate();

    return () => {
      window.removeEventListener('resize', resizeCanvas);
      window.removeEventListener('mousemove', handleMouseMove);
      window.removeEventListener('mouseenter', handleMouseEnter);
      window.removeEventListener('mouseleave', handleMouseLeave);
      cancelAnimationFrame(animationId);
    };
  }, []);

  return (
    <BackgroundContainer>
      <Canvas ref={canvasRef} />

      {/* Mouse trail */}
      <MouseTrail 
        style={{ 
          left: mousePosition.x - 15, 
          top: mousePosition.y - 15,
          opacity: isHovering ? 1 : 0.7
        }} 
      />

      {/* Floating tech/finance icons */}
      {techIcons.map((item, index) => (
        <FloatingElement
          key={index}
          className="floating-element"
          color={item.color}
          hoverColor={item.hoverColor}
          size="40px"
          delay={`${index * 0.5}s`}
          style={{
            left: `${10 + (index * 6) % 80}%`,
            top: `${20 + (index * 7) % 60}%`,
          }}
        >
          {item.icon}
        </FloatingElement>
      ))}

      {/* Chart lines */}
      {[0, 1, 2, 3].map((index) => (
        <ChartLine
          key={`chart-${index}`}
          color={['#00d4ff', '#00ff88', '#ffd700', '#ff6b6b'][index]}
          delay={`${index * 2}s`}
          style={{
            top: `${30 + index * 15}%`,
            width: '100%',
          }}
        />
      ))}

      {/* Data points */}
      {chartData.map((point, index) => (
        <DataPoint
          key={`data-${index}`}
          color={point.color}
          delay={`${index * 0.5}s`}
          style={{
            left: `${point.x}%`,
            top: `${point.y}%`,
          }}
        />
      ))}

      {/* Grid lines */}
      {[0, 1, 2, 3, 4].map((index) => (
        <GridLine
          key={`grid-${index}`}
          color="#00d4ff"
          delay={`${index * 1.5}s`}
          style={{
            top: `${20 + index * 15}%`,
            left: 0,
            width: '100%',
            height: '1px',
          }}
        />
      ))}

      {/* Vertical grid lines */}
      {[0, 1, 2, 3, 4].map((index) => (
        <GridLine
          key={`vgrid-${index}`}
          color="#00d4ff"
          delay={`${index * 1.2}s`}
          style={{
            left: `${20 + index * 15}%`,
            top: 0,
            width: '1px',
            height: '100%',
          }}
        />
      ))}
    </BackgroundContainer>
  );
};

export default AnimatedBackground;
